import React, { useState } from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Modal, TextInput, FlatList, Image } from 'react-native';

const ScheduleSharing = ({ schedule }) => {
  const [modalVisible, setModalVisible] = useState(false);
  const [shareOption, setShareOption] = useState(null);
  const [recipients, setRecipients] = useState('');
  const [message, setMessage] = useState('');

  // Mock contacts list
  const contacts = [
    { id: '1', name: 'Alice Smith', avatar: 'https://randomuser.me/api/portraits/women/1.jpg', favorite: true },
    { id: '2', name: 'Bob Johnson', avatar: 'https://randomuser.me/api/portraits/men/1.jpg', favorite: true },
    { id: '3', name: 'Carol Williams', avatar: 'https://randomuser.me/api/portraits/women/2.jpg', favorite: true },
    { id: '4', name: 'Dave Brown', avatar: 'https://randomuser.me/api/portraits/men/2.jpg', favorite: false },
    { id: '5', name: 'Eva Davis', avatar: 'https://randomuser.me/api/portraits/women/3.jpg', favorite: false },
  ];

  const handleShareSchedule = () => {
    setModalVisible(true);
  };

  const handleSelectShareOption = (option) => {
    setShareOption(option);
  };

  const handleSubmitShare = () => {
    // In a real app, this would connect to sharing API
    console.log(`Shared schedule via ${shareOption} with: ${recipients}`);
    console.log(`Message: ${message}`);

    // Reset and close modal
    setShareOption(null);
    setRecipients('');
    setMessage('');
    setModalVisible(false);
  };

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Share Your Schedule</Text>

      <Text style={styles.description}>
        Share your daily plan with friends, family, or colleagues to coordinate activities and stay accountable.
      </Text>

      <View style={styles.buttonContainer}>
        <TouchableOpacity 
          style={styles.shareButton}
          onPress={handleShareSchedule}
        >
          <Text style={styles.shareButtonText}>Share Schedule</Text>
        </TouchableOpacity>
      </View>

      {/* Modal for sharing options */}
      <Modal
        animationType="slide"
        transparent={true}
        visible={modalVisible}
        onRequestClose={() => setModalVisible(false)}
      >
        <View style={styles.modalContainer}>
          <View style={styles.modalContent}>
            <Text style={styles.modalTitle}>
              {!shareOption 
                ? 'Share Your Schedule'
                : `Share via ${shareOption.charAt(0).toUpperCase() + shareOption.slice(1)}`}
            </Text>

            {!shareOption ? (
              <View style={styles.shareOptions}>
                <TouchableOpacity 
                  style={styles.optionButton}
                  onPress={() => handleSelectShareOption('message')}
                >
                  <View style={[styles.optionIcon, { backgroundColor: '#4CAF50' }]}>
                    <Text style={styles.optionIconText}>‚úâÔ∏è</Text>
                  </View>
                  <Text style={styles.optionText}>Message</Text>
                </TouchableOpacity>

                <TouchableOpacity 
                  style={styles.optionButton}
                  onPress={() => handleSelectShareOption('email')}
                >
                  <View style={[styles.optionIcon, { backgroundColor: '#2196F3' }]}>
                    <Text style={styles.optionIconText}>üìß</Text>
                  </View>
                  <Text style={styles.optionText}>Email</Text>
                </TouchableOpacity>

                <TouchableOpacity 
                  style={styles.optionButton}
                  onPress={() => handleSelectShareOption('link')}
                >
                  <View style={[styles.optionIcon, { backgroundColor: '#9C27B0' }]}>
                    <Text style={styles.optionIconText}>üîó</Text>
                  </View>
                  <Text style={styles.optionText}>Copy Link</Text>
                </TouchableOpacity>
              </View>
            ) : (
              <View style={styles.shareForm}>
                <Text style={styles.formLabel}>
                  {shareOption === 'link' ? 'Your schedule link:' : 'Send to:'}
                </Text>

                {shareOption === 'link' ? (
                  <View style={styles.linkContainer}>
                    <Text style={styles.linkText}>https://scheduler.app/share/d8f2h3r</Text>
                    <TouchableOpacity style={styles.copyButton}>
                      <Text style={styles.copyButtonText}>Copy</Text>
                    </TouchableOpacity>
                  </View>
                ) : (
                  <>
                    <TextInput
                      style={styles.input}
                      value={recipients}
                      onChangeText={setRecipients}
                      placeholder={shareOption === 'email' ? 'Email addresses' : 'Phone numbers'}
                    />

                    <Text style={styles.formLabel}>Frequent contacts:</Text>
                    <FlatList
                      data={contacts.filter(c => c.favorite)}
                      horizontal
                      showsHorizontalScrollIndicator={false}
                      keyExtractor={item => item.id}
                      renderItem={({ item }) => (
                        <TouchableOpacity 
                          style={styles.contactItem}
                          onPress={() => setRecipients(recipients ? `${recipients}, ${item.name}` : item.name)}
                        >
                          <Image source={{ uri: item.avatar }} style={styles.contactAvatar} />
                          <Text style={styles.contactName}>{item.name}</Text>
                        </TouchableOpacity>
                      )}
                      style={styles.contactsList}
                    />

                    <Text style={styles.formLabel}>Message (optional):</Text>
                    <TextInput
                      style={[styles.input, styles.messageInput]}
                      value={message}
                      onChangeText={setMessage}
                      placeholder="Add a personal message..."
                      multiline
                    />
                  </>
                )}

                <TouchableOpacity 
                  style={styles.submitButton}
                  onPress={handleSubmitShare}
                >
                  <Text style={styles.submitButtonText}>
                    {shareOption === 'link' ? 'Done' : 'Send'}
                  </Text>
                </TouchableOpacity>
              </View>
            )}

            <TouchableOpacity
              style={styles.closeButton}
              onPress={() => {
                setShareOption(null);
                setModalVisible(false);
              }}
            >
              <Text style={styles.closeButtonText}>Cancel</Text>
            </TouchableOpacity>
          </View>
        </View>
      </Modal>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: 'white',
    borderRadius: 12,
    padding: 16,
    marginVertical: 10,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 3,
  },
  title: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 10,
    color: '#333',
  },
  description: {
    fontSize: 14,
    color: '#666',
    marginBottom: 15,
    lineHeight: 20,
  },
  buttonContainer: {
    alignItems: 'center',
  },
  shareButton: {
    backgroundColor: '#3498db',
    paddingVertical: 12,
    paddingHorizontal: 20,
    borderRadius: 6,
    minWidth: 200,
    alignItems: 'center',
  },
  shareButtonText: {
    color: 'white',
    fontWeight: 'bold',
    fontSize: 16,
  },

  // Modal styles
  modalContainer: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
  },
  modalContent: {
    backgroundColor: 'white',
    borderRadius: 12,
    padding: 20,
    width: '85%',
    maxHeight: '80%',
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.3,
    shadowRadius: 5,
    elevation: 5,
  },
  modalTitle: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 20,
    textAlign: 'center',
    color: '#333',
  },
  shareOptions: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    marginVertical: 20,
  },
  optionButton: {
    alignItems: 'center',
    width: 80,
  },
  optionIcon: {
    width: 50,
    height: 50,
    borderRadius: 25,
    justifyContent: 'center',
    alignItems: 'center',
    marginBottom: 8,
  },
  optionIconText: {
    fontSize: 24,
  },
  optionText: {
    fontSize: 14,
    color: '#333',
    fontWeight: '500',
  },
  shareForm: {
    marginVertical: 10,
  },
  formLabel: {
    fontSize: 14,
    fontWeight: '500',
    color: '#555',
    marginBottom: 8,
    marginTop: 12,
  },
  input: {
    borderWidth: 1,
    borderColor: '#ddd',
    borderRadius: 6,
    padding: 10,
    fontSize: 16,
  },
  messageInput: {
    height: 80,
    textAlignVertical: 'top',
  },
  linkContainer: {
    flexDirection: 'row',
    borderWidth: 1,
    borderColor: '#ddd',
    borderRadius: 6,
    padding: 10,
    marginBottom: 15,
    alignItems: 'center',
  },
  linkText: {
    flex: 1,
    fontSize: 14,
    color: '#3498db',
  },
  copyButton: {
    backgroundColor: '#f0f0f0',
    paddingVertical: 6,
    paddingHorizontal: 12,
    borderRadius: 4,
  },
  copyButtonText: {
    fontSize: 12,
    fontWeight: '600',
    color: '#555',
  },
  contactsList: {
    marginVertical: 10,
  },
  contactItem: {
    alignItems: 'center',
    marginRight: 15,
    width: 70,
  },
  contactAvatar: {
    width: 50,
    height: 50,
    borderRadius: 25,
    marginBottom: 5,
  },
  contactName: {
    fontSize: 12,
    color: '#333',
    textAlign: 'center',
  },
  submitButton: {
    backgroundColor: '#3498db',
    paddingVertical: 12,
    borderRadius: 6,
    alignItems: 'center',
    marginTop: 20,
  },
  submitButtonText: {
    color: 'white',
    fontWeight: 'bold',
    fontSize: 16,
  },
  closeButton: {
    backgroundColor: '#f0f0f0',
    paddingVertical: 10,
    borderRadius: 6,
    alignItems: 'center',
    marginTop: 15,
  },
  closeButtonText: {
    color: '#555',
    fontWeight: '600',
    fontSize: 14,
  },
});

export default ScheduleSharing;
